import { useNavigate } from "react-router-dom";

export const RedirectButton = ({ previousPage }) => {
  let navigate = useNavigate();
  const redirectLink = previousPage ? previousPage : -1;
  return (
    <>
      <button onClick={() => navigate(redirectLink)}>Back</button>
    </>
  );
};
